ejala perdarahan, Monitor nilai hematokrit/hemoglobin sebelum dan setelah kehilangan darah, Monitor tanda-tanda vita ortostatis, Pertahankan bedrest selama perdarahan, Jelaskan tanda dan gejala perdarahan, Anjurkan meningkatkan asupan makanan dan vitamin K, Kolaborasi pemberian terapi.</div><div>PP Malam:</div><div>Identifikasi penyebab hipertermia, Monitor suhu tubuh, Basahi dan kipasi permukaan tubuh, Berikan cairan oral, Kolaborasi pemberian cairan dan elektrolit intavena, Monitor tanda dan gejala perdarahan, Monitor nilai hematokrit/hemoglobin sebelum dan setelah kehilangan darah, Monitor tanda-tanda vita ortostatis, Pertahankan bedrest selama perdarahan, Jelaskan tanda dan gejala perdarahan, Anjurkan meningkatkan asupan makanan dan vitamin K, Kolaborasi pemberian terapi.  <b>R/ Cek DR/hr.</b></div></p>', NULL, '1624', 0, NULL, '2025-06-09 10:46:49')
